import 'bootstrap/dist/css/bootstrap.min.css'
import './App.css';

import { Switch, Route } from 'react-router-dom'

import UsersList from './pages/Users-list/Users-list'
import UserDetails from './pages/User-details/User-details'
import UserForm from './pages/User-form/er-form'

function App() {
  return (
    <>
   <UsersList />
   <Switch>
   <Route path="/usuarios" exact render={() => <UserList />} />
   <Route path="/usuarios/:user_id" render={props => <UserDetails {...props} />} />
   {/* <Route path="/crear" render={() => <UserForm />} /> */}
 </Switch>
 </>
  );
}

export default App;
